import $ from "jquery";

export const List = (props, {}) => {
  const [userId, setUserId] = useState(props.userId);

  const [registers, setRegisters] = useState(null);

  const getRegisterInfo = () => {
    $.ajax({
      cache: false,
      type: "GET",
      url: "https://localhost:44323/Users/GetUserList?userId=" + userId,
      success: function (data, textStatus, jqXHR) {
        console.log(JSON.parse(data));
        setRegisters(JSON.parse(data));
        console.log(registers);
        return JSON.parse(data);
      },
      error: function (jqXHR, textStatus, errorThrown) {
        return null;
      },
    });
  };

  const [list, setList] = useState(getRegisterInfo);

  return (
    <div className="container">
      <div className="table-responsive">
        <table className="table">
          <thead>
            <tr>
              <th scope="col">#</th>
              <th scope="col">Nombre</th>
              <th scope="col">Eliminar</th>
            </tr>
          </thead>
          <tbody>
            {registers !==null ? (
              registers.Elements.map((registro, index) => (
                <tr key={index}>
                  <th>{index + 1}</th>
                  <td>{registro.Name}</td>
                  <td className="text-center">
                    <button>borrar
                      <i class="fas fa-solid fa-trash-can"></i>
                    </button>{" "}
                  </td>
                </tr>
              ))
            ) : (
              <tr> <td>No hay registros en la lista</td></tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};
